import React from "react";
import TodoItem from "./Item/TodoItem";
import { BsBookmarkCheck } from "react-icons/bs";

const todos = [
  {
    _id: "23",
    title: "finish yor homework",
    isCompleted: false,
  },
  {
    _id: "233",
    title: "wash dishes",
    isCompleted: false,
  },
  {
    _id: "243",
    title: "watch TV",
    isCompleted: false,
  },
];
const Home = () => {
  return (
    <div className="Home">
      <div className="layout">
        {todos.map((todo) => (
          <TodoItem className="layout" key={todo._id} todo={todo} />
        ))}
      </div>
    </div>
  );
};
export default Home;
